import React from "react";
import axios from "axios";
import "./CatalogItem.css";
import { Link } from "react-router-dom";

const CatalogItem = ({ item }) => {
  const [image, setImage] = React.useState("");

  React.useEffect(() => {
    axios
      .get(`/products?new=true&category=${item}`, {
        headers: {
          "Content-Type": "application/json",
        },
      })
      .then(({ data }) => {
        setImage(data[0].img[0].path);
      });
  }, [item]);

  return (
    <div className="catalog__itemm">
      <div className="catalog__itemm-img mr-1">
        <img
          width={"60px"}
          src="/uploads/2022-02-13T09:53:17.750Zphoto_2021-02-02_00-43-21.jpg"
          alt=""
        />
      </div>
      <div className="catalog__itemm-content">
        <span style={{ fontSize: "24px" }}>category</span>
        <span>subcategory</span>
        <span>subcategory</span>
        <span>subcategory</span>
        <span>...</span>
      </div>
    </div>
  );
};

export default CatalogItem;
